        "Desc": "击败深海龙蜥之后，可以拾取到的一截生物组织。<br>虽然看起来像是鲨鳍，但其实并不发挥什么作用。<br>曾经的白夜国之民对深海龙蜥有深入的研究。它们最为不同的一点就是可以靠意志决定自身特征的去留与遗传。因为厌恶人造光源，龙蜥成年就会失去视觉上的大部分细节；同时为了战斗，它们进化出了其他元素的行为多型性。",
